import{_ as a,o as t,c as e,S as s}from"./chunks/framework.a3dd33a8.js";const o="/doc/assets/2339cb98.9f405ffb.png",r="/doc/assets/351c9dab.2c391c4f.png",p="/doc/assets/21ba715c.ee56f860.png",c="/doc/assets/bf026dca.cee38d94.png",_="/doc/assets/b0a50304.46a140ad.png",i="/doc/assets/869f4ace.a262d780.png",k=JSON.parse('{"title":"团队管理","description":"","frontmatter":{},"headers":[],"relativePath":"base/product/DDD可视化开发平台文档/操作指南/平台和项目管理/组织团队管理/团队管理.md","filePath":"base/product/DDD可视化开发平台文档/操作指南/平台和项目管理/组织团队管理/团队管理.md","lastUpdated":1706585121000}'),n={name:"base/product/DDD可视化开发平台文档/操作指南/平台和项目管理/组织团队管理/团队管理.md"},d=s('<h1 id="团队管理" tabindex="-1">团队管理 <a class="header-anchor" href="#团队管理" aria-label="Permalink to &quot;团队管理&quot;">​</a></h1><blockquote><p>描述：对当前组织下的团队进行管理和维护</p></blockquote><h2 id="_2-2-1-团队创建" tabindex="-1">2.2.1 团队创建 <a class="header-anchor" href="#_2-2-1-团队创建" aria-label="Permalink to &quot;2.2.1 团队创建&quot;">​</a></h2><p>（1）点击团队管理模块，选择“添加团队”功能；</p><p>（2）在弹出的页面“团队名称”栏中输入团队名称，例如“开发云”；</p><p>（4）在“描述”栏中输入该团队的描述信息；</p><p>（4）在“管理员”栏中选择用户作为该团队的管理员；</p><p>（5）点击“保存”按钮，系统将自动创建该团队并分配唯一的组织ID。 <img src="'+o+'" alt=""><br></p><h2 id="_2-2-2-团队更新" tabindex="-1">2.2.2 团队更新 <a class="header-anchor" href="#_2-2-2-团队更新" aria-label="Permalink to &quot;2.2.2 团队更新&quot;">​</a></h2><p>（1）进入团队管理模块，选择要编辑的团队；</p><p>（2）在团队详情中点击“编辑”按钮，进入编辑页面；</p><p>（3）在各栏中更新团队相关信息, 如组织名称、描述、关联管理员等；</p><p>（4）完成修改后，点击“保存”按钮，团队信息更新成功并返回团队详情页。 <img src="'+r+'" alt=""><br></p><h2 id="_2-2-3-团队删除" tabindex="-1">2.2.3 团队删除 <a class="header-anchor" href="#_2-2-3-团队删除" aria-label="Permalink to &quot;2.2.3 团队删除&quot;">​</a></h2><p>（1）点击团队管理模块，选择要删除的团队；</p><p>（2）在团队详情中点击“删除”按钮，系统会弹出确认框进行二次确认；</p><p>（3）点击确认后，该组织将被标记为删除状态并移除团队列表。</p><p>需要注意的是，在进行团队删除操作时，需要进行二次确认，以防止误删；团队删除成功后，将无法恢复已删除的团队信息，请谨慎操作。 <img src="'+p+'" alt=""><br></p><h2 id="_2-2-4-团队查询" tabindex="-1">2.2.4 团队查询 <a class="header-anchor" href="#_2-2-4-团队查询" aria-label="Permalink to &quot;2.2.4 团队查询&quot;">​</a></h2><p>（1）点击团队管理模块，选择“查询团队”功能；</p><p>（2）在弹出的查询页面中输入关键词，例如“开发云”；</p><p>（3）点击“查询”按钮，系统将返回与输入关键词匹配的团队列表，用户可以选择查看所需团队信息。</p><p>需要注意的是，在进行团队查询操作时，可以使用关键词搜索来缩减查询的范围，便于快速查找所需团队信息。 <img src="'+c+'" alt=""><br></p><h2 id="_2-2-5-团队跳转" tabindex="-1">2.2.5 团队跳转 <a class="header-anchor" href="#_2-2-5-团队跳转" aria-label="Permalink to &quot;2.2.5 团队跳转&quot;">​</a></h2><p>（1）点击团队管理模块，选择“进入空间”功能，即可快速跳转到对应团队管理界面； <img src="'+_+'" alt=""><br></p><p>（2）进入团队对应的团队首页 <img src="'+i+'" alt=""><br></p>',26),l=[d];function h(b,m,u,f,q,g){return t(),e("div",null,l)}const P=a(n,[["render",h]]);export{k as __pageData,P as default};
